                <TodosLoading />
                <TodosLoading />
              </>}
              {error && <TodosError />}
              {(!loading &&  searchedFoods.length === 0) &&  <EmptyTodos />}
              {searchedFoods.map( shop => (
                <TodoItem 
                  key={shop.text} 
                  text={shop.text}
                  completed ={shop.completed}
                  onComplete ={() => buyedFood(shop.text)}
                  onDelete={()=> deleteFood(shop.text)}
                   />
              ))}
          </TodoList>

          <CreateTodoButton/>

        </>
      );
}

export { AppUI};
